import time
import csv

memo = {}

def hailstone(n):
    if n == 1:
        return 1
    if n in memo:

        return memo[n]
    if n % 2 == 0:
        memo[n] = 1 + hailstone(n // 2)
        return memo[n]
    else:
        memo[n] = 1 + hailstone(3*n+1)
        return memo[n]


def hailstone2(n):
    count = 1
    while n != 1:
        n = 3*n+1 if n % 2 else n // 2
        count += 1
    return count

def time_function(f):
    initial = time.time()
    f()
    return time.time() - initial

def store_memo():
    w = csv.writer(open("memos.csv", "w"))
    for key, val in memo.items():
        w.writerow([key, val])

def load_memo():
    global memo
    for key, val in csv.reader(open("memos.csv")):
        memo[int(key)] = int(val)

